        <div class=" border py-3 px-4 h-100" style={{borderRadius:22, backgroundColor:"#202730"}}>
            <h1 class="fs-5 text-start">{text}</h1>
            <div class ="border w-100">

            </div>
        </div>
    </div>
  )
}

export default BlocQuestion;
